@Ana Ferreira, devemos tomar a vacina para ter a segurança de não agravar a doença, caso venhamos a contrair o vírus, que não é impossível, mesmo com todos os cuidados. 
Com a vacina, continuaremos com as medidas necessárias de proteção, porém sem medo. 
Sem a vacina, o medo de contrair o vírus é muito grande, mesmo com os cuidados necessários.

